import React from "react";

function Navbar() {
  return (
    <nav className="nav">
      {/* <img className="nav-img" src="cart.png" alt="cart" /> */}
      <h2>DL Shop</h2>
      <ul>
        <li>Profile</li>
        <li>Favorite</li>
        <li>Cart</li>
      </ul>
    </nav>
  );
}

export default Navbar;
